class Solution217 {
    fun containsDuplicate(nums: IntArray): Boolean {
        val set = hashSetOf<Int>()
//        set.addAll(nums.toList())
//        return set.size!=nums.size
        for (i in nums){
            if(i in set){
                return true
            }
            set.add(i)
        }
        return false
    }
}

